import React from 'react';
import './App.css';
import BoardItem from 'components/Boarditem';
import { latestBoardListMock } from 'mocks';

function App() {
  return (
    <>
      {latestBoardListMock.map(BoardListItem => <BoardListItem boardListItem={BoardListItem} />)}
    </>
  );
}

export default App;
